css:
.go-plus-table {
  width: 100%;
  border-collapse: collapse;
  border-spacing: 0;
}
.go-plus-table-header {
  border-bottom: 1px solid rgba(0, 0, 0, 0.5);
}
.go-plus-table-row:hover {
  background-color: #4182C4;
}
.go-plus-table-cell {
  padding: 5px 10px;
}
.go-plus-left-pad {
  padding-left: 24px;
}
